import React, { Component } from 'react'

class Nav extends Component {
  render() {
    return (
      <nav>
        <h1>
          <i className="far fa-sticky-note"></i>StitchMate</h1>
        <ul>
          <li>Log In/Sign Up</li>
          <li>FAQs</li>
          <li>Share buttons</li>
        </ul>
      </nav>
    )
  }
}

export default Nav
